import React, { useState, useEffect } from 'react';
import {GiAbstract086} from 'react-icons/gi'

const Work = ()=>{
    const [appList,setappList] = useState([])
    const [unblockedapp,setunBlockList] = useState([])

    useEffect(async() => {
        console.log('sent the req.')
        const data = await fetch("/blockedApps")
        const res = await data.json()
        setappList(res);

        const unblockedapps = await fetch('/unblockedApps')
        const res2 = await unblockedapps.json()
        setunBlockList(res2);

      },[]);
    return(
        <>
        <div className='row'>
            <div className='col-lg-6'>
                <h4>Blocked Apps - count</h4>
                <div className='appsList mt-4 m-auto p-4'>
                {appList.map((item)=>{
                        return (
                            <div>
                                
                                <p key={item['_id']}><GiAbstract086 className='symbol'/>
                                    {item['app_name']}
                                    <div class="custom-control custom-switch float-right">
                                        <input type="checkbox" class="custom-control-input" id={item['_id']}/>
                                        <label class="custom-control-label" for={item['_id']}>Blocked</label>
                                    </div>
                                </p>
                                
                                <hr/>
                            </div>
                            )
                    })}
                </div>
            </div>
            <div className='col-lg-6'>
                <h4>Other Installed apps -count</h4>
                <div className='appsList mt-4'>
                {unblockedapp.map((item)=>{
                        return (
                            <div>
                                
                                <p key={item['_id']}><GiAbstract086 className='symbol'/>{item['app_name']}
                                <div class="custom-control custom-switch float-right">
                                        <input type="checkbox"  class="custom-control-input" id="customSwitches"/>
                                        <label class="custom-control-label" for="customSwitches">Block</label>
                                    </div>
                                </p><hr/>
                            </div>
                            )
                    })}
                </div>
            </div>
        </div>

        </>

    )
}

export default Work;
